import React from 'react';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import Carousel from 'react-bootstrap/Carousel';
import 'bootstrap/dist/css/bootstrap.min.css'; // Bootstrap CSS 임포트
import FristImage from './images/frist.jpg';
import SecondImage from './images/second.jpg';
import ThreeImage from './images/three.jpg';




// 네비게이션 바 컴포넌트
function ColorSchemesExample() {
  return (
    <Navbar bg="dark" data-bs-theme="dark" fixed="top" style={{ height: '80px' }}>
      <Container>
        <Navbar.Brand href="#home" style={{ fontSize: '1.5rem', color: '#ffffff' }}>
          인프라팀
        </Navbar.Brand>
        <Nav className="me-auto">
          <Nav.Link href="#공지사항" style={{ fontSize: '1.2rem', color: '#ffffff' }}>
            공지사항
          </Nav.Link>
          <Nav.Link href="#프로젝트관리" style={{ fontSize: '1.2rem', color: '#ffffff' }}>
            프로젝트 관리
          </Nav.Link>
          <Nav.Link href="#자료실" style={{ fontSize: '1.2rem', color: '#ffffff' }}>
            자료실
          </Nav.Link>
          <Nav.Link href="#개발도구" style={{ fontSize: '1.2rem', color: '#ffffff' }}>
            개발 도구
          </Nav.Link>
          <Nav.Link href="#일정회의" style={{ fontSize: '1.2rem', color: '#ffffff' }}>
            일정 및 회의
          </Nav.Link>

        </Nav>
      </Container>
    </Navbar>
  );
}


// 캐러셀 이미지 컴포넌트
function ExampleCarouselImage({ text }) {
    return (
      <div
        style={{
          height: '400px', // 슬라이드 높이 조정
          backgroundColor: '#ddd',
          display: 'flex',
          justifyContent: 'center',
          alignItems: 'center',
          fontSize: '2rem',
        }}
      >
        {text}
      </div>
    );
  }

 // 캐러셀 컴포넌트
function UncontrolledExample() {
    return (
      <Carousel>
        <Carousel.Item>
          <img
            className="d-block w-100"
            src={FristImage}
            alt="First slide"
          />
          <Carousel.Caption>
            <h3>11월 프로젝트일정</h3>
            <p>개발팀분들 확인 바랍니다.</p>
          </Carousel.Caption>
        </Carousel.Item>
        <Carousel.Item>
          <img
            className="d-block w-100"
            src={SecondImage}
            alt="Second slide"
          />
          <Carousel.Caption>
            <h3>희망퇴직 인원 모집</h3>
            <p>특별 희망 퇴직금 4억3000만원</p>
          </Carousel.Caption>
        </Carousel.Item>
        <Carousel.Item>
          <img
            className="d-block w-100"
            src={ThreeImage}
            alt="Third slide"
          />
          <Carousel.Caption>
            <h3>~~~</h3>
            <p></p>
          </Carousel.Caption>
        </Carousel.Item>
      </Carousel>
    );
  }


// 합친 메인 컴포넌트
function InfraMain() {
  return (
    <>
      {/* 네비게이션 바 */}
      <ColorSchemesExample />

      {/* 네비게이션 바 아래 여백 추가 */}
      <div style={{ marginTop: '0px' }}>
        {/* 캐러셀 */}
        <UncontrolledExample />
      </div>
    </>
  );
}

export default InfraMain;
